import React from 'react';

export default function AboutPage() {
  return (
    <div style={{padding:'48px',textAlign:'center'}}>
      <h1>About CrippleFN</h1>
      <p style={{maxWidth:600,margin:'24px auto',fontSize:'1.15em'}}>
        CrippleFN is an innovative platform that leverages multimodal artificial intelligence and blockchain technology to fight disinformation. Our mission is to empower users to verify the authenticity of content, detect fake news, and contribute to a more trustworthy digital ecosystem. Join us in the fight against misinformation!
      </p>
    </div>
  );
}
